import React, {useState} from 'react';
import About from './Components/About';
import Home from './Components/Home';
import Contact from './Components/Contact';
const App = () => {
  const [about,setAbout]= useState(false);

  const aboutpage = () => {
    setAbout(!about);
  };

  const [contact,setContact]= useState(false);

  const contactpage = () => {
    setContact(!about);
  };


  if (about) {
    return (
      <div>
        <About/>
        <button onClick={about=false}>Go back to homepage </button>
      </div>
    )
  }
  if (contact) {
    return (
      <div>
        <Contact/>
        <button onClick={contact=false}>Go back to homepage </button>
      </div>
    )
  }

  return (
    <div>
    <Home/>
    <button onClick={aboutpage}>Go to about</button>
    <button onClick={contactpage}>Go to contact</button>
    </div>
    )
}

export default App;
